create database if not exists eupravaSSO
CHARACTER SET utf8mb4
COLLATE utf8mb4_0900_ai_ci;
SET NAMES utf8mb4;
use eupravaSSO;


create table if not exists Opstina(
    PTT integer,
    naziv varchar(20),
    primary key (ptt)
    ) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci;;

create table if not exists Gradjani(
    JMBG varchar(13) ,
    Ime varchar (30),
    Prezime varchar (30),
    Adresa varchar(60),
    BrojTelefona varchar(13),
    Email varchar(35),
    Lozinka varchar(62),
    OpstinaID  integer,

    primary key(JMBG),
    foreign key (OpstinaId) references Opstina(PTT)
    )  CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci;;

